  false,\n\t\"url\": null,\n\t\"notes\": \"Data depicts the locations of historic
  structures associated with the Wabash-Erie, Central, and Whitewater Canals constructed
  in Indiana in from 1830-1870. Canal historians have searched county courthouse records
  and archived state engineering reports to plot canal structures on USGS 7.5 minute
  quadrangles. Some locations of the canal structures are unknown and approximated
  as indicated in the table. Some historic structures are known to be destroyed.\",\n\t\"license_title\":
